import React from 'react';

const About = () => {
    return (
        <div className="page-section">
            <h2 className="section-title">About Me</h2>
            <div className="about-content">
                <div className="about-text">
                    <p>
                        I am a passionate developer with over 5 years of experience in building modern web applications. 
                        I specialize in the MERN stack but love exploring new technologies.
                    </p>
                    <p>
                        When I'm not coding, you can find me hiking, playing chess, or contributing to open-source projects.
                    </p>
                    <div className="stats">
                        <div className="stat-item"><strong>50+</strong> Projects Completed</div>
                        <div className="stat-item"><strong>5+</strong> Years Experience</div>
                    </div>
                </div>
            </div>
        </div>
    );
};
export default About;
